Нужен капитальный ремонт квартиры в Москве – обращайтесь в нашу компанию. «Нивона» предоставляет гарантии долговечности и надежности, эксклюзивного дизайна и непревзойденного комфорта.

Виды работ при капитальном ремонте

демонтаж стен, старого оборудования, электропроводки;
расширение или создание дверных и оконных проемов;
возведение новых перегородок;
заполнение пустот в стенах;
монтаж новых коммуникаций;
выравнивание пола, стен, потолков с предварительной зачисткой до основания;
перенос водопроводных и канализационных труб;
укладку кафельной плитки, керамогранита, всех типов напольных покрытий, оклейку обоев, покраску;
установку сантехники, замену радиаторов отопления.
